import React from "react";
import {Card,Container,CardBody,CardTitle,CardText} from "reactstrap";
import {FaEnvelope,FaMapMarkedAlt,FaPhone,FaPortrait} from "react-icons/fa"


const MyCard = ({details})=>{
    return(
        <Card>
            <CardBody className="text-center">
                <img 
                height="150"
                width="150"
                className="rounded-circle img-thumbnail border-danger"
                src={details.picture?.large}
                />
                <FaPortrait/>
                <CardTitle className="">{details.name?.title}  {details.name?.first} {details.name?.last} </CardTitle>
            </CardBody>
        </Card>
    )
}



export default MyCard;
